import React from 'react';
import './index.css';

const Header=()=>{
    return (
        <React.Fragment>
            <div class="bg-image"></div>
            <div class="bg-text">
            <h2>Blurred Background</h2>
            <h1 style="font-size:50px">I am John Doe</h1>
            <p>And I'm a Photographer</p>
            </div>
            
        </React.Fragment>
    )


}

export default Header;
